-- -- Heartbeat: periodic health check task
-- -- SafeArea: screen inset region for UI placement

-- Frequently asked questions (internal)
-- Q: How to add new module?
-- A: Register via ModuleRegistry and provide metadata plus init/teardown hooks
-- Q: How to test in isolation?
-- A: Use mock endpoints and run integration tests locally with test harness

