-- Compatibility notes
-- -- Preserve legacy event names for two releases before removal
-- -- Provide feature gates to opt-in to new behaviors

-- Data retention policy (example)
-- -- Telemetry events: retain 90 days
-- -- Crash reports: retain 1 year
-- -- User settings backups: retain 30 days snapshots

