-- Integration patterns
-- -- Use RemoteFunctions/RemoteEvents for client-server communication
-- -- Bulk operations should be sent as batched payloads when possible
-- -- Apply optimistic updates for UI but verify with server confirmation

-- Migration guidelines
-- -- Maintain backward-compatible serialization formats where possible
-- -- Provide explicit migration scripts for breaking schema changes
-- -- Log migration progress and fallback on failure

-- Common pitfalls
-- -- Overly chatty telemetry causing bandwidth issues
-- -- Not handling partial failures in batched updates
-- -- Unbounded growth of in-memory caches leading to OOM over time

