-- -- Support sampling strategies to control telemetry volume

-- Runtime considerations
-- -- Detect and adapt to low-memory conditions (reduce retained caches)
-- -- Respect power-saving modes on mobile devices (lower update rates)
-- -- Use coarse timers for background checks when app is inactive

-- UX guidelines
-- -- Keep action verbs concise and consistent across UI
-- -- Use progressive disclosure for advanced settings
-- -- Provide inline validation and contextual help

-- Accessibility details
-- -- Support large text modes and ensure components scale
